import React from 'react'
import "./SingleResult.css"

const SingleResult = ({ result }) => {

  const selectedRecipe = (dish) => {
    alert("selected this dish :" + dish)
  }

  const enterKey = (enter_key_event) => {
    if(enter_key_event.key === 'Enter'){
      selectedRecipe(result.recipe.label)
    }
  }

  return (
    <div className="singleSearch" onKeyDown={enterKey} onClick={() => selectedRecipe(result.recipe.label)}>
        {result.recipe.label}
    </div>
  )
}

export default SingleResult
